import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <main>
        <Routes>
          <Route path="./main" element={<Main />}></Route>
        </Routes>
      </main>
    </BrowserRouter>
  );
}

export default App;
